import React from "react";
import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles((theme) => ({
  svgHover: {
    fill: theme.palette.foreground.default,
    "&:hover": {
      fill: theme.palette.primary.main,
    },
    transition: "all 0.5s ease",
  },
}));

export const Logo = () => {
  const classes = useStyles();

  return (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      viewBox="0 0 200 200"
      className={classes.svgHover}
    >

      {/* Letra R (em vez de P) */}
      <rect className="cls-1" x="60" y="40" width="10" height="120" rx="5" />
      <path
        className="cls-1"
        d="M70,40 L70,50 C80,40 100,40 100,60 L100,100 C100,120 80,120 70,110 L70,200 L60,200 L60,110 C50,120 30,120 30,100 L30,60 C30,40 50,40 60,40 Z"
      />
      <rect className="cls-1" x="110" y="40" width="10" height="60" rx="5" />
      <rect className="cls-1" x="60" y="90" width="60" height="10" rx="5" />
    </svg>
  );
};
